import React, { Component } from 'react';
import ProductDetails from './Productdetails';
export  default class ProductList extends Component{

constructor(props)
{
  super(props);
this.state={
 products: [{"name":"car",imageurl:"https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/Tata_Nano_Yellow.jpg/280px-Tata_Nano_Yellow.jpg",description:"Car is yellow color,made 2 years back",price:"3 lakh"},
 {"name":"jeans",imageurl:"https://upload.wikimedia.org/wikipedia/commons/thumb/d/d2/Jeans_for_men.jpg/220px-Jeans_for_men.jpg",description:"Jeans is blue color,rayo matrial",price:"300"},
 {"name":"pen",imageurl:"https://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Carandache_Ecridor.jpg/220px-Carandache_Ecridor.jpg",description:"NovoPen 4 is an insulin pen that can deliver insulin doses from 1 to 60 units, in increments of 1 units", price:"20"},
 {"name":"saree",imageurl:"https://upload.wikimedia.org/wikipedia/commons/thumb/3/35/Bomkai3.jpg/220px-Bomkai3.jpg",description:"Saree is made of jute material.Dry wash only product.Best party wear", price:"500"},
 {"name":"shoes",imageurl:"data:image/jpeg;base64,",description:"Shoe is made of rough material.Suitable for rough use.", price:"400"},
 {"name":"watch",imageurl:"data:image/jpeg;base64,",description:"Saree is made of jute material.Dry wash only product.Best party wear", price:"500"},
]
};

}
render(){
let listOfProductsDisplayed='';
if(this.props.search==''){
  listOfProductsDisplayed=this.state.products.map((product,index)=>{
      return <ProductDetails key={index} details={product}/>
    })
}
else{
  let filterProducts=this.state.products.filter((product,index)=>{
    return product.name.includes(this.props.search) 
  });

  listOfProductsDisplayed=filterProducts.map((product,index)=> {return <ProductDetails key={index} details={product}/>
})

}






// let listofMoviesDisplayed = this.state.movies.map((movie,index)=>{
//   return <MovieDetails key={index} details={movie}/>
// })
  return(
  <div>

  
  {listOfProductsDisplayed}
  
  </div>
  )
}
}